import React from 'react';
import JohnNguyenImg from './images/team/John-Nguyen.jpg';

const Team = () => {
  return (
    <div className="container-fluid">
    <h3>Meet Our Team!</h3>
      <div className="row">
        <div className="col">
          <img src={JohnNguyenImg} alt="John Nguyen"/>
        </div>
        <div className="col-7">
          <p>Description</p>
        </div>
      </div>
    </div>
  )
}

export default Team;
